import React from 'react';

const ProfitLoss = () => {
    return (
        <div className='inc-exp-container'>
            <div>
                <h4>Income</h4>
                <p className='money plus' id='money-plus'>$500.00</p>
            </div>
            <div>
                <h4>Expenses</h4>
                <p className='money minus' id='money-minus'>$240.00</p>
            </div>
        </div>
    )
};

export default ProfitLoss;
